/**
 * @param {number[]} nums
 * @param {number[]} multipliers
 * @return {number}
 */
var maximumScore = function(nums, multipliers) {
    const map = {};
    const isSameNum = nums.every(num => num === nums[0]);
    const getMax = (mIdx, nLeftIdx, nRightIdx) => {
        const cacheKey = `${mIdx}-${nLeftIdx}`;
        if (map[cacheKey] !== undefined) return map[cacheKey];

        const multiplier = multipliers[mIdx];
        const isLastMulti = mIdx === multipliers.length - 1;
        // console.log({mIdx, nLeftIdx, nRightIdx, isLastMulti});

        if (isSameNum) {
            return multiplier * nums[nLeftIdx] + (isLastMulti ? 0 : getMax(mIdx + 1, nLeftIdx + 1, nRightIdx));
        }

        const max = Math.max(
            multiplier * nums[nLeftIdx] + (isLastMulti ? 0 : getMax(mIdx + 1, nLeftIdx + 1, nRightIdx)),
            multiplier * nums[nRightIdx] + (isLastMulti ? 0 : getMax(mIdx + 1, nLeftIdx, nRightIdx - 1))
        );

        map[cacheKey] = max;

        return max;
    };

    console.log(nums.length, multipliers.length);
    return getMax(0, 0, nums.length - 1);
};

